    crossorigin=""></script>
    <div id="mapid"></div>

       <p>Informaci√≥n Vuelos </p>
    {mapa.map(posicion => {
        if (posicion){ return (
        <div>{posicion.code};{posicion.position}</div>)}})}
      </div>

    );
}

export default Map;
